import React, { Component } from "react";
import styled from "styled-components";

import logo from "../cirlce.svg";

const Wrapper = styled.div.attrs({
  className:
    "container px-4 mx-autp flex flex-wrap items-center justify-between",
})``;

const LogoDiv = styled.div.attrs({
  className:
    "w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start",
});

class Logo extends Component {
  render() {
    return (
      <>
        <Wrapper>
          <LogoDiv>
            <img src={logo} width="50" height="50" alt="Logo.svg" />
          </LogoDiv>
        </Wrapper>
      </>
    );
  }
}

export default Logo;
